import Note from "./components/Note";

import { useState } from "react";

const App = ({props}) => {

  const [notes, setNotes] = useState(notes)




  return (
    <>
      <h1>Notes</h1>
      <ul>
        {notes.map(note=>
        <Note key={note.id} note={note}/>  
        )}
      </ul>
    </>
  )
}

export default App;
